import './App.css';
import firebase from "firebase/app";
import "firebase/auth";
import firebaseConfig from './components/CreateAccount/FireBaseConfig';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


firebase.initializeApp(firebaseConfig);


function App() {
  return (
    <Router>
      <Switch>
        <Route exact path='/'></Route>
      </Switch>
    </Router>
  );
}

export default App;
